import { styled } from "styled-components";

import "./QRCode.css";

const FlexContainer = styled.div`
  display: flex;
  justify-content: center;
`;

const QRContainer = styled.div`
  width: 1024px;
  position: relative;
  margin: 16px 106px 0 106px;
  &: img {
    width: 1024px;
  }
`;

const QRCodeContainer = () => {
  return (
    <FlexContainer>
      <QRContainer>
        <img src="https://m.bunjang.co.kr/pc-static/resource/237e17f5cbe07edc8fff.png"></img>
        <div id="QRCodeBackground">
          <img src="data:image/png;base64,"></img>
        </div>
      </QRContainer>
    </FlexContainer>
  );
};

export default QRCodeContainer;
